  public Database defaultEbeanServer(ServerConfig defaultEbeanServerConfig) {
    return EbeanServerFactory.create(defaultEbeanServerConfig);
  }

  @Bean
  public UserDomainService userDomainService() {
    return new UserDomainService();
  }
}

